      "uri": "http://hackage.haskell.org/package/EdisonCore/docs/Data-Edison-Seq-BraunSeq.html#",
      "description": {
        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eOne-sided Braun sequences.  All running times are as listed in\n   \u003ca\u003eData.Edison.Seq\u003c/a\u003e except the following:\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e lview, lcons, ltail*   \u003ccode\u003eO( log n )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e rcons, rview, rhead*, rtail*, size   \u003ccode\u003eO( log^2 n )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e copy, inBounds, lookup*, update, adjust  \u003ccode\u003eO( log i )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e append            \u003ccode\u003eO( n1 log n2 )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e concat            \u003ccode\u003eO( n + m log m )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e drop, splitAt     \u003ccode\u003eO( i log n )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e subseq            \u003ccode\u003eO( i log n + len )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e reverseOnto       \u003ccode\u003eO( n1 log n2 )\u003c/code\u003e\n\u003c/li\u003e\u003cli\u003e concatMap, (\u003e\u003e=)  \u003ccode\u003eO( n * t + m log m )\u003c/code\u003e, where \u003ccode\u003en\u003c/code\u003e is the length of the input sequence\n                                               \u003ccode\u003em\u003c/code\u003e is the length of the output sequence and \u003ccode\u003et\u003c/code\u003e\n                                               is the running time of \u003ccode\u003ef\u003c/code\u003e\n\u003c/li\u003e\u003c/ul\u003e\u003cp\u003eBy keeping track of the size, we could get rcons, rview, rhead*, and rtail*\n   down to \u003ccode\u003eO(log n)\u003c/code\u003e as well; furthermore, size would be \u003ccode\u003eO( 1 )\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003e\u003cem\u003eReferences:\u003c/em\u003e\n\u003c/p\u003e\u003cul\u003e\u003cli\u003e Rob Hoogerwoord. \"A symmetric set of efficient list operations\".\n     \u003cem\u003eJournal of Functional Programming\u003c/em\u003e, 2(4):505--513, 1992.\n\u003c/li\u003e\u003cli\u003e Rob Hoogerwoord. \"A Logarithmic Implementation of Flexible Arrays\".\n     \u003cem\u003eMathematics of Program Construction\u003c/em\u003e (MPC'92), pages 191-207.\n\u003c/li\u003e\u003cli\u003e Chris Okasaki. \"Three algorithms on Braun Trees\".\n     \u003cem\u003eJournal of Function Programming\u003c/em\u003e 7(6):661-666. Novemebr 1997.\n\u003c/li\u003e\u003c/ul\u003e\u003c/div\u003e",
        "fct-module": "Data.Edison.Seq.BraunSeq",
        "fct-package": "EdisonCore",
        "fct-signature": "module",
        "fct-source": "src/Data-Edison-Seq-BraunSeq.html",
        "fct-type": "module",
        "title": "BraunSeq"
      },
