        "fct-descr": "\u003cdiv class=\"doc\"\u003e\u003cp\u003eThis module defines a sequence adaptor \u003ccode\u003eRev s\u003c/code\u003e.\n   If \u003ccode\u003es\u003c/code\u003e is a sequence type constructor, then \u003ccode\u003eRev s\u003c/code\u003e\n   is a sequence type constructor that is identical to \u003ccode\u003es\u003c/code\u003e,\n   except that it is kept in the opposite order.\n   Also keeps explicit track of the size of the sequence,\n   similar to the \u003ccode\u003eSized\u003c/code\u003e adaptor in \u003ca\u003eData.Edison.Seq.SizedSeq\u003c/a\u003e.\n\u003c/p\u003e\u003cp\u003eThis module is most useful when s is a sequence type\n   that offers fast access to the front but slow access\n   to the rear, and your application needs the opposite\n   (i.e., fast access to the rear but slow access to the\n   front).\n\u003c/p\u003e\u003cp\u003eAll time complexities are determined by the underlying\n   sequence, except that the complexities for accessing\n   the left and right sides of the sequence are exchanged,\n   and size becomes \u003ccode\u003eO( 1 )\u003c/code\u003e.\n\u003c/p\u003e\u003c/div\u003e",
